description:
TFI Live: Real Time updates and Journey Planning in one app

Description:
The TFI Live App, brought to you by the National Transport Authority (NTA) aims to make accessing Real Time service information and Journey Planning across the Transport for Ireland network as seamless as possible. 
Key features of the App include:                             
•Ability to view Real Time departure information for Bus Éireann, Dublin Bus, Go Ahead Ireland, Luas, Iarnród Éireann Irish Rail, TFI Local Link and other TFI services;
•Option to select your origin and destination to find the best route for your journey;
•Search tool for route specific timetables and maps;
•Function to save your favourite journeys, departures and timetables for quick access on the go.

We hope you enjoy using the TFI Live App. 
For more information on the Transport for Ireland (TFI) network, visit www.transportforireland.ie

# # #


Updates coming soon:


• New arrangements to be displayed on the app in instances where services are unexpectedly disrupted;
• Unforeseen amendments to the routes to be displayed when searching using the ‘leave now’ feature;
•Departures originating from different stops to be displayed in chronological order within the timetable. Currently it is advised to use the ‘earlier’ and ‘later’ buttons when searching bus departures for the most accurate information;
• Ability to view all intermediate stops when searching rail timetables. Currently the appropriate information will appear in your journey plan suggestions;
• Accurate information on Luas trip duration to be displayed when using the ‘leave now’ function. It is currently suggested you use the ‘leave after’ or ‘arrive by’ options for best search results;


The NTA is a statutory body which oversees the delivery and regulation of public transports services in Ireland.
